import { Link } from 'react-router-dom';
import '../css/Home.css';
import burakImage from '../assets/burak-profile.jpg';

function Home () {
    return(
        <div>
            <div className='homeMainDiv'>
                <div className='homeFirstDiv'>
                    <div className="photograph"><img src={burakImage} className="burakImage"/></div>
                    <div className="nameSurname">Burak Gündoğan</div>
                    <div className="title">Jr.Frontend/Full-Stack/Backend Developer</div>
                    <div className="socialMedias">Sosyal Medya Hesaplarım ve Github Hesabım</div>
                    <div className="copyright">Copyright © 2025 - Tüm Hakları Saklıdır.</div>
                </div>


                <div className='homeSecondDiv'>
                    <p className="blog">BLOG SAYFAM</p>
                    <p className='routerToHomePage'>Anasayfaya devam etmek için <Link to="/homepage">tıklayınız !</Link></p>
                    <p className='routerToLoginPage'>Kayıt olmak için <Link to="/register">tıklayınız !</Link></p>
                    <p className='routerToRegisterPage'>Giriş yapmak için <Link to="/login">tıklayınız !</Link></p>
                </div>
            </div>
        </div>
    )
}

export default Home;
